text:
@jgirls_mag is pleased to be partnering with the @athenafilmfest an engaging weekend of feature films, documentaries and shorts that highlight powerful stories about courageous and audacious women leaders. the four-day festival includes inspiring films; conversations with directors, actors, and activists; and workshops for filmmakers and film fans.
the festival will be held february 28 - march 3 at @barnardcollege in new york city. visit www.athenafilmfestival.com to see this year's lineup and get your tickets! join us at #athena19 to celebrate stories of ambition and courage, amplify public discourse on gender equality, and change the face of leadership. #athenafilmfestival #barnard #newyorkcity #nyc #newyork #ny #film #filmfestival #nyfilmfestival #director #actor #activist #genderequality #timesup #metoo #jewishgirlslead 
